<style scoped>
    .layout{
        background: url(data:image/jpeg;base64,) no-repeat;
        overflow: hidden;
        background-size: cover;
    }
    .layout-logo{
        width: 132px;
        height: 52px;
        background: url("../../public/images/logo-nav.png") center center no-repeat;
        position: relative;
        top: 8px;
        float: left;
    }
    .user-control{
        float: right;
    }
    .layout-footer-center{
        text-align: center;
        background: rgb(226, 217, 204);
        border-top: 1px solid;
    }
    .circle {
        width:350px;
        height:88px;
        top: -87px;
        left: 0;
        background: url("../../public/images/login2.png") right center no-repeat;
        position: absolute;
    }
</style>
<template>
    <div class="layout">
        <Layout :style="{background: 'transparent'}">
            <Header :style="{position: 'fixed', width: '100%', background:'#e2d9cc', borderBottom: '1px solid'}">
                <div class="layout-logo"></div>
                <div class="user-control">
                    <Button type="text" :style="{color: '#565353'}" ghost @click="showLoginModal">
                        <Avatar :style="{backgroundColor: '#87d068', width: '25px', height: '25px', fontSize: '20px', lineHeight: '25px', margin: '0 5px 2px 0'}" icon="ios-person" />
                        <span v-model="user.name">{{user.name}}</span>
                    </Button>
                </div>
            </Header>
            <Content :style="contentStyle">
                Content
            </Content>
            <Footer class="layout-footer-center">2020-2120 &copy; Gaea Soft</Footer>
        </Layout>

        <!--  -->
        <Modal v-model="isShowLogin" :closable="false" width="350px" :styles="{top: '152px'}">
            <div class="circle"></div>
            <Form ref="loginForm" :model="formData" :rules="ruleValidate">
                <FormItem prop="email" :show-message="false" :style="{marginBottom: '5px'}">
                    <Label :style="{fontSize: '13px', lineHeight: '5px'}"><span style="color:red">*</span> </Label>
                    <Input prefix="ios-mail" v-model="formData.email"></Input>
                </FormItem>
                <FormItem prop="password" :show-message="false" :style="{marginBottom: '30px'}">
                    <Label :style="{fontSize: '13px', lineHeight: '5px'}"><span style="color:red">*</span> </Label>
                    <Input prefix="ios-lock" v-model="formData.password" type="password" password ></Input>
                </FormItem>
            </Form>
            <div slot="footer">
                <Button type="primary" size="large" long @click="handleLogin" :loading="isDoLogin">
                    <span v-if="!isDoLogin"> !</span>
                    <span v-else>...</span>
                </Button>
            </div>
        </Modal>
    </div>
</template>
<script>
    import {login} from "./api/login";
    import {getInfo} from "./api/user";

    export default {
        name: 'App',
        data() {
            return {
                contentStyle: {
                    height: '',
                    minHeight: '500px',
                    background: 'rgb(255, 255, 255, 0.85)'
                },
                isShowLogin: false,
                isDoLogin: false,
                formData: {
                    email: '',
                    password: ''
                },
                ruleValidate: {
                    password: [
                        { required: true, message: '', trigger: 'blur' }
                    ],
                    email: [
                        { required: true, message: '', trigger: 'blur' },
                    ]
                },
                user: {
                    name: ''
                }
            }
        },
        created() {
            this.computeContentHeight();
            this.getUserInfo();
        },
        computed:{

        },
        methods: {
            getUserInfo() {
                getInfo().then(response => {
                    console.log(response);
                    this.user.name = response.data.name;
                }).catch(error => {
                    setTimeout(() => {
                        this.isShowLogin = true
                    }, 2000)
                });
            },
            computeContentHeight() {
                this.contentStyle.height = window.innerHeight - 71 + 'px';
            },
            showLoginModal() {
                if (this.user.name !== '') return;
                this.isShowLogin = true;
            },
            handleLogin() {
                this.$refs.loginForm.validate((valid) => {
                    if (valid) {
                        this.isDoLogin = true;
                        login(this.formData).then(response => {
                            window.localStorage.setItem('gaea.token', response.data.token);
                            this.user.name = response.data.name;
                            this.isDoLogin = false;
                            this.isShowLogin = false;
                            this.handleReset();
                            this.$Message['success']({
                                background:true,
                                content: ''
                            });
                        }).catch(error => {
                            this.isDoLogin = false;
                        });
                    } else {
                        this.$Message.error('');
                    }
                });
            },
            handleReset() {
                this.formData = {
                    email: '', password: ''
                }
            }
        }
    }
</script>
